    "clean-water-act",nt"isopen": false,nt"url": null,nt"notes": "The
    Clean Water Act (CWA) establishes the basic structure for regulating discharges
    of pollutants into U.S. waters and regulating quality standards for surface waters.
    The basis of the CWA was enacted in 1948 and was called the Federal Water Pollution
    Control Act, but the Act was significantly reorganized and expanded in 1972. "Clean
    Water Act" became the Act's common name through amendments in 1977. The CWA's goal
    is to restore and maintain the chemical, physical, and biological integrity of the
    Nation's waters. Source: http://www.epa.gov/lawsregs/laws/cwa.html Date Enacted:
    June 30, 1948 Codification: 33 U.S.C Section 1251 et seq. Authority: U.S. Environmental
    Protection Agency When investigating geo-regulatory boundaries near the boundary
    edges, users should consult the most up to date applicable jurisdictional boundaries
    available on MarineCadastre.gov. These geo-regulatory boundaries have not been updated
    in more than 13 years.",nt"license_title": null,nt"extras": [{ntt"key":
